          </>
        )} /> */}
        <Route path='/' element={
          <>
            <Banner />
            <Movies />
          </>
        } />
        <Route path="/favorites" element={<Favorites />} />
      </Routes>
      {/* <Banner/>  */}
      {/* <Movies/> */}
      {/* <Favorites/> */}
    </Router>
  );
}

export default App;
